window.bookSummaryJSON = "Visit the magical animal world of Brian Jacques in this thrilling prequel to <i>Redwall</i>. Long before the abbey of Redwall is built, the land is known simply as Mossflower, a lush woodland and happy home to all. That is, until Tsarmina, a cruel wildcat queen who demands obedience and offers the castle's dungeon to those who defy her, comes along. Brian Jacques' tales of courageous heroes and deliciously hateful villains have captivated countless readers."; 
